const Form = () =>{

   let [name, setName] =  useState()

    const inputEvent = (event) =>{
        console.log('change');
        console.log(event.target.value);;;
        setName(event.target.value);


    }
   return (
       <>
       <div>
           <h1>Hello {name}</h1>
           <input  type='text' placeholder="Enter Your Name" onChange={inputEvent} value={name} />
           <button > Click Me 👍 </button>
       </div>
       </>
   )
}

export default Form;
